import React from 'react';

function CardItem({ podcast }) {
  return (
    <li className='cards__item'>
      <div className='cards__item__link'>
        <figure className='cards__item__pic-wrap'>
          <video className='cards__item__video' controls>
            <source src={podcast.videoSrc} type='video/mp4' />
            Your browser does not support the video tag.
          </video>
        </figure>
        <div className='cards__item__info'>
          <h5 className='cards__item__title'>{podcast.title}</h5>
          <p className='cards__item__keywords'>Keywords: {podcast.keywords.join(', ')}</p>
        </div>
      </div>
    </li>
  );
}

export default CardItem;
